import React, { useEffect, useState } from 'react';
import PocketBase from 'pocketbase';

const pb = new PocketBase('http://127.0.0.1:8090');

export default function VolumeUnits() {
  const [units, setUnits] = useState([]);

  useEffect(() => {
    async function fetchUnits() {
      const result = await pb.collection('units').getFullList({
        filter: 'category ~ "Volume"',
        sort: 'to_base_factor'
      });
      setUnits(result);
    }
    fetchUnits();
  }, []);

  return (
    <div>
      <h1>Volume Units</h1>
      <ul>
        {units.map(unit => (
          <li key={unit.id}>{unit.name} ({unit.symbol}) - {unit.to_base_factor}</li>
        ))}
      </ul>
    </div>
  );
}
